void teleport_tile(int x1, int y1, int x2, int y2){
  char temp = gameState[y1][x1][0];
  if (x1 == doneLocs[activeLevel-1][0] && y1 == doneLocs[activeLevel-1][1])
    gameState[y1][x1][0] = 'F';
  else
    gameState[y1][x1][0] = ' '; //Replace with empty
  
  if (pushAfterTeleport) {
    int idx = 0;
    for(int i = 0;i<4;i++){
      if(newDirX==possibleMoves[i][0] && newDirY==possibleMoves[i][1]){
        idx = i;
        break;
      }
    }
    if (idx == 0) {
      gameState[y2][x2][0] = 'D';
    } else if (idx == 1) {
      gameState[y2][x2][0] = 'L';
    } else if (idx == 2) {
      gameState[y2][x2][0] = 'U';
    } else {
      gameState[y2][x2][0] = 'R';
    }
  } else {
    if ((temp == 'R') || (temp == 'L') || (temp == 'U') || (temp == 'D'))
      gameState[y2][x2][0] = 'C';
    else
      gameState[y2][x2][0] = temp;
  }
}

//Check if this move is valid based on its bounds
bool check_move_bounds(int x, int y, int dirX, int dirY){
  return gameState[y+dirY][x+dirX][0] !=  '-' && gameState[y+dirY][x+dirX][0] != 'W';
}

//Check if it is possible to move to 
bool check_teleport(int teleportX, int teleportY, int dirX, int dirY, bool character){
  //Find the index of the passed in direction in possibleMoves
  int idx = 0;
  for(int i = 0;i<4;i++){
    if(dirX==possibleMoves[i][0] && dirY==possibleMoves[i][1]){
      idx = i;
      break;
    }
  }
  //Loop through directions in CW to find any empty space
  for(int i = 0;i<4;i++){
    //newDirX and newDirY are global variables
    newDirX = possibleMoves[(i+idx)%4][0];
    newDirY = possibleMoves[(i+idx)%4][1];
    if(gameState[teleportY+newDirY][teleportX+newDirX][0]==' '){
      return true;
    }
  }
  if(!character){
    //Since we are teleporting box and theres no space, teleport not possible
    return false;
  }
  //pushAfterTeleport is a global variable
  pushAfterTeleport = true;
  //Since we are teleporting character, check if there is pushable box now
  for(int i = 0;i<4;i++){
    //newDirX and newDirY are global variables
    newDirX = possibleMoves[(i+idx)%4][0];
    newDirY = possibleMoves[(i+idx)%4][1];
    if(gameState[teleportY+newDirY][teleportX+newDirX][0]=='B'
      && check_box_move(teleportX+newDirX, teleportY+newDirY, newDirX, newDirY)){
      return true;
    }
  }
  //No space even considering box push
  return false;
}

//check if box can be moved in the certain direction
bool check_box_move(int boxX, int boxY, int dirX, int dirY){
  //Check if it is blocked by bounds
  if(!check_move_bounds(boxX, boxY, dirX, dirY)){
    return false;
  }
  //Check if it is blocked another box or wall
  if(gameState[boxY+dirY][boxX+dirX][0]=='B' || gameState[boxY+dirY][boxX+dirX][0]=='W' || gameState[boxY+dirY][boxX+dirX][0]=='-'){
    return false;
  }
  return true;
}

/*-------------------- DRAWING -------------------------*/
void plot_pixel(int x, int y, short int line_color) {
  volatile short int *one_pixel_address;

  one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);

  *one_pixel_address = line_color;
}

// Function to clear the screen (display all pixels as black)
void clear_screen() {
	for (int i = 0; i < 320; i++) {
		for (int j = 0; j < 240; j++) {
			plot_pixel(i, j, 0);
		}
	}
}

//Undraws the previously rendered game state (2 frames before current)
void undraw_gamestate(){
  for(int r = 0;r<mapVals[activeLevel - 1][2];r++){
    for(int c = 0;c<mapVals[activeLevel - 1][3];c++){
      if(gameState[r][c][1]!=gameState[r][c][0] && gameState[r][c][0] != '-'){
        //this tile needs to be undrawn since it differes
        erase_temp(mapVals[activeLevel - 1][0] + c*12, mapVals[activeLevel - 1][1] + r*12);
      }else{
        continue;
      }
    }
  }
}

//Function to draw current game state
void draw_gamestate() {
  int mapOffsetX = mapVals[activeLevel - 1][0];
  int mapOffsetY = mapVals[activeLevel - 1][1];
  for(int r = 0;r<mapVals[activeLevel - 1][2];r++){
    for(int c = 0;c<mapVals[activeLevel - 1][3];c++){
      if(gameState[r][c][0]=='C'){
        draw_character(mapOffsetX+c*12, mapOffsetY+r*12, character);
      } else if(gameState[r][c][0]=='B' && c == doneLocs[activeLevel-1][0] && r == doneLocs[activeLevel-1][1]){
        draw_box(mapOffsetX+c*12, mapOffsetY+r*12, box_done);
      } else if (gameState[r][c][0]=='B') {
        draw_box(mapOffsetX+c*12, mapOffsetY+r*12, box);
      } else if (gameState[r][c][0] == 'F') {
        draw_highlight(mapOffsetX+c*12, mapOffsetY+r*12);
      } else if (gameState[r][c][0] == 'W') {
        draw_wall(mapOffsetX+c*12, mapOffsetY+r*12, 1);
      } else if(gameState[r][c][0] == 'P')  {
        draw_portal(mapOffsetX+c*12, mapOffsetY+r*12);
      } else if (gameState[r][c][0] == 'U') {
        draw_character(mapOffsetX+c*12, mapOffsetY+r*12, push_up);
      } else if (gameState[r][c][0] == 'D') {
        draw_character(mapOffsetX+c*12, mapOffsetY+r*12, push_down);
      } else if (gameState[r][c][0] == 'L') {
        draw_character(mapOffsetX+c*12, mapOffsetY+r*12, push_left);
      } else if (gameState[r][c][0] == 'R') {
        draw_character(mapOffsetX+c*12, mapOffsetY+r*12, push_right);
      }
    }
  }
}

void reset_game() {
  characterX = mapVals[activeLevel - 1][4];
  characterY = mapVals[activeLevel - 1][5];
  for (int r = 0; r < mapVals[activeLevel - 1][2]; r++) {
    for (int c = 0; c < mapVals[activeLevel - 1][3]; c++) {
      if (activeLevel == 1){
        gameState[r][c][0] = level1GameState[r][c];
        gameState[r][c][1] = level2GameState[r][c];
        gameState[r][c][2] = level2GameState[r][c];
      }else if(activeLevel == 2){
        gameState[r][c][0] = level2GameState[r][c];
        gameState[r][c][1] = level2GameState[r][c];
        gameState[r][c][2] = level2GameState[r][c];
      }
    }
  }
  clear_screen();
  draw_background();
  draw_gamestate();
}

// Draw initial game background
void draw_background() {
	int counter = 0;
  for (int i = 0; i < mapVals[activeLevel - 1][6]; i++) {
    for (int j = 0; j < mapVals[activeLevel-1][7]; j++) {
      if (activeLevel == 1) {
        plot_pixel(mapVals[activeLevel-1][0]+j, mapVals[activeLevel-1][1]+i, background1[counter]);
      } else if (activeLevel == 2) {
        plot_pixel(mapVals[activeLevel-1][0]+j, mapVals[activeLevel-1][1]+i, background2[counter]);
      }
      counter++;
    }
  }
}

void draw_wall(int x, int y, int wallNum) {
  int counter = 0;
  for (int i = 0; i < 12; i++) {
    for (int j = 0; j < 12; j++) {
      if(wallNum == 1) {
        if (wall1[counter] != 1)
          plot_pixel(x+j, y+i, wall1[counter]);
      }
      counter++;
    }
  }
}

// Function to draw the spots where the boxes need to be pushed
void draw_highlight(int x, int y) {
  int counter = 0;
  for (int i = 0; i < 4; i++) {
    for(int j = 0; j < 4; j++) {
      if (spot_highlight[counter] != -1)
        plot_pixel(x + j + 4,y + i + 4, spot_highlight[counter]);
      counter++;
    }
  }
}

// Function to draw character at specified location
void draw_character(int x, int y, const short int characterType[]) {
  int counter = 0;
  for (int i = 0; i < 12; i++) {
    for (int j = 0; j < 12; j++) {
      if (characterType[counter] != 1) {
        plot_pixel(x + j, y + i, characterType[counter]);
      }
      counter++;
    }
  }
}

// Function to draw the crates that are pushed
void draw_box(int x, int y, const short int boxArray[]) {
  int counter = 0;
  for (int i = 0; i < 12; i++) {
    for(int j = 0; j < 12; j++) {
      plot_pixel(x + j, y + i, boxArray[counter]);
      counter++;
    }
  }
}

