// Function to wait 1/60th of a second (for the current frame to finish rendering)
void wait_for_vsync() {
  volatile int *pixel_ctrl_ptr = (int *)0xFF203020;
  int status;

  *pixel_ctrl_ptr = 1;  // starts the sync process
  // Poll the S until it becomes 0
  status = *(pixel_ctrl_ptr + 3);
  while ((status & 0x1) != 0) {
    status = *(pixel_ctrl_ptr + 3);
  }
}

// =================== HEX DISPLAY =========================
//Converts a digit to its corresponding hex segment display value
unsigned int digit_to_hex_val(unsigned int val){
  if(val==1){
    return 0x06;
  }else if(val==2){
    return 0x5B;
  }else if(val==3){
    return 0x4F;
  }else if(val==4){
    return 0x66;
  }else if(val==5){
    return 0x6D;
  }else if(val==6){
    return 0x7D;
  }else if(val==7){
    return 0x07;
  }else if(val==8){
    return 0x7F;
  }else if(val==9){
    return 0x6F;
  }else{
    //Assume 0 by default
    return 0x3F;
  }
}
void set_hex(int hexNum, unsigned int val){
  unsigned int t = *hex0_ptr;
  if(hexNum==0){
    *hex0_ptr = (t & 0xFFFFFF00)+(val);
  }else if(hexNum==1){
    *hex0_ptr = (t & 0xFFFF00FF)+(val << 8);
  }else if(hexNum==2){
    *hex0_ptr = (t & 0xFF00FFFF)+(val << 16);
  }else if(hexNum==3){
    *hex0_ptr = (t & 0x00FFFFFF)+(val << 24);
  }
}

// ============= PS2 Controller ==============
char make_code_to_letter(unsigned int val){
    if(val==0x1C){
        return 'A';
    }else if(val==0x32){
        return 'B';
    }else if(val==0x1D){
        return 'W';
    }else if(val==0x1B){
        return 'S';
    }else if(val==0x23){
        return 'D';
    }else if(val==0x29){
        return ' '; //Space
    }else{
        return '%'; //Return % by default
    }
}

int levelSelect() {
  volatile int *switches_ptr = (int *)0xFF200040;
  int select = *switches_ptr;
    while ((select != 2) && (select != 4)) {
      select = *switches_ptr;
    }
    if (select == 2) {
      return 1;
    } 
    return 2;
}

void switchPoll() {
  volatile int *switches_ptr = (int *)0xFF200040;
  int select = *switches_ptr;
    while (select != 8) {
      select = *switches_ptr;
    }
}

bool isDone() {
  if (gameState[doneLocs[activeLevel-1][1]][doneLocs[activeLevel-1][0]][0] == 'B')
    return true;
  return false;
}